public class InnerNotificationChannelNotificationChannelConfigFactory(Action<Humidifier.DevOpsGuru.NotificationChannelTypes.NotificationChannelConfig> factoryAction = null) : SubResourceFactory<Humidifier.DevOpsGuru.NotificationChannelTypes.NotificationChannelConfig>
{

    internal InnerNotificationChannelNotificationFilterConfigFactory FiltersFactory { get; set; }

    internal InnerNotificationChannelSnsChannelConfigFactory SnsFactory { get; set; }

    protected override Humidifier.DevOpsGuru.NotificationChannelTypes.NotificationChannelConfig Create()
    {
        var notificationChannelConfigResult = CreateNotificationChannelConfig();
        factoryAction?.Invoke(notificationChannelConfigResult);

        return notificationChannelConfigResult;
    }

    private Humidifier.DevOpsGuru.NotificationChannelTypes.NotificationChannelConfig CreateNotificationChannelConfig()
    {
        var notificationChannelConfigResult = new Humidifier.DevOpsGuru.NotificationChannelTypes.NotificationChannelConfig();

        return notificationChannelConfigResult;
    }
    public override void CreateChildren(Humidifier.DevOpsGuru.NotificationChannelTypes.NotificationChannelConfig result)
    {
        base.CreateChildren(result);

        result.Filters ??= FiltersFactory?.Build();
        result.Sns ??= SnsFactory?.Build();
    }

} // End Of Class

